   Greting = 'Good Mornig';
   css.color  = 'orange';
}else if(curDate > 12 && curDate < 19){
  Greting = 'Good Afternoon';
  css.color = 'green';
}else{
  Greting = 'Good Night';
  css.color = 'black';
}

